import './contact.css'
import matric from './matric.png'
// import linked from './linked.png'


function Con() {
  return (
    <div className="Con">
      <h1>highschool page</h1>
      <h5 className='text-light'>University Graduate</h5>
      <links>
        <a
          
          href="https://www.maryvalecollege.co.za/home/home.php"
          target="_blank"
          rel="noopener noreferrer"
        >
          <h1>highschool page</h1>
        </a>
        <results>
        <img src={matric} className="matric" alt="matric-cert"/>
        </results>
      </links>
      
    </div>
  );
}

export default Con;
